import { Observable, ObservableInput, SchedulerLike } from "rxjs";
/**
 * Emits the values from all the streams of the provided object, in a result
 * which provides the key of the stream of that emission.
 *
 * @param input object of streams
 */
export declare const mergeWithKey: <O extends {
    [P in keyof any]: ObservableInput<any>;
}, OT extends {
    [K in keyof O]: O[K] extends ObservableInput<infer V> ? {
        type: K;
        payload: V;
    } : unknown;
}>(x: O, concurrent?: number, scheduler?: SchedulerLike) => Observable<OT[keyof O]>;
